import "./SidePanel.scss";
export const SidePanel = ({
  dataPosition,
  isVisible = true,
  content,
  ...props
}) => {
  return (
    <aside
      className="panel"
      data-position={props["data-position"]}
      style={{ display: isVisible ? "none" : "block" }}
    >
      {content}
    </aside>
  );
};
